import AddMessage from '../AddMessage/AddMessage'
import { useSelector } from 'react-redux';

const Footer = () => {
  
  const isAuthAdmin = useSelector((state) => state.adminReducer.isAuthAdmin);

  return (
    <div>
      {isAuthAdmin ? null : <AddMessage/>}
     

 <h1>footer</h1>

      </div>
  )
}

export default Footer
